const user = {
    name: 'YOO',
    imageUrl: 'https://preview.redd.it/fallen-angels-v0-wdk2688j5hec1.png?width=1080&crop=smart&auto=webp&s=dec90ac7d89e770013c18158aa595474ce4a68d4',
    imageSize: 150,
  };
  
  export default function Profile() {
    return (
      <div
          style={{
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            margin: 0, // Reset margin
            padding: 0
           // height: '100vh', // Set the height of the container to the viewport height
          }}
        >

        <a href="/" style={{ margin: 0, padding: 0 }}>
          <img
            className="avatar"
            src={user.imageUrl}
            alt={'Photo of ' + user.name}
            style={{
              //marginTop: '10px',
              display: 'inline-block',
              width: user.imageSize,
              height: user.imageSize,
              cursor: 'pointer',
              borderRadius: 80,
              margin: 'auto',
              alignItems: 'center'
            }}
          />
        </a>
      </div>
    );
  }
